import React, { useState, useEffect } from 'react';

export default function Dashboard() {
  const [payments, setPayments] = useState([]);

  useEffect(() => {
    // Fetch payment data from your API or database
    fetch('http://localhost:8002/api/paymentDetails')
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok ' + response.statusText);
        }
        return response.json();
      })
      .then(data => setPayments(data))
      .catch(error => {
        console.error('There was a problem with the fetch operation:', error);
      });
  }, []);

  return (
    <div>
      <h1>Admin Panel</h1>
      <h2>Payments</h2>
      <ul>
        {payments.map((payment, index) => (
          <li key={index}>
            <div>Customer: {payment.customer_id}</div>
            <div>Payment Method: {payment.payment_method}</div>
            <div>Amount: {payment.amount}</div>
            <div>Products: {payment.products.join(', ')}</div>
          </li>
        ))}
      </ul>
    </div>
  );
}
